import { createTheme } from "@mui/material/styles";

const theme = createTheme({
  palette: {
    primary: {
      main: "#2c3260", // Match your background
    },
    secondary: {
      main: "#b30000", // Match navbar color
    },
    background: {
      default: "#2c3260",
      paper: "#f4f4f4",
    },
  },
  typography: {
    fontFamily: "'Roboto Flex', sans-serif",
    main:"f4f4f4",
  },
});

export default theme;
